import React, { useState } from "react";

const TestList = () => {
  let [list, listChange] = useState([
    { id: 1, name: "A", age: 1 },
    { id: 2, name: "B", age: 2 },
    { id: 3, name: "C", age: 3 },
  ]);

  return (
    <div>
      <div className="container-lg">
        {list.map((item, idex) => {
          return (
            <div className="row">
              <div>
                <p>{item.name}</p>
                <p>{item.age}</p>
              </div>
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default TestList;
